import React from 'react';
import { MDBInput, MDBFormInline} from 'mdbreact';

class Home extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
    };
  }

  render() {
    return (
      <div className="mb-4" style={{ marginTop: '70px' }}>

        <h2 className="h1-responsive text-center my-4">Order management</h2>

        <MDBFormInline>
          {/* <div class="form-row col-12" style={{ border: '' }}> */}
            {/* <div className='col-1'> */}
              <label style={{ fontWeight: 'bold', marginRight: '2px' }}>Order:</label>
            {/* </div> */}
            <MDBInput label="Id." outline />
            <MDBInput label="Id." outline />
            <MDBInput label="Id." outline />
            <MDBInput label="Id." outline />
          {/* </div> */}
          {/* <div class="form-row col-12" style={{ border: '' }}> */}
            {/* <div className='col-1'> */}
              <label style={{ fontWeight: 'bold', marginRight: '2px' }}>Customer:</label>
            {/* </div> */}
            <MDBInput label="Id." outline />
            <MDBInput label="Id." outline />
            <MDBInput label="Id." outline />
            <MDBInput label="Id." outline />
          {/* </div> */}
          {/* <div class="form-row col-12" style={{ border: '' }}> */}
            {/* <div className='col-1'> */}
              <label style={{ fontWeight: 'bold', marginRight: '2px' }}>Product:</label>
            {/* </div> */}
            <MDBInput type='text' label="Id." outline />
            <MDBInput type='text' label="Id." outline />
            <MDBInput type='number' label="Id." outline />
            <MDBInput type='number' label="Id." outline />
            <MDBInput type='number' label="Id." outline />
            <MDBInput type='number' label="Id." outline />
            <MDBInput label="Filled-in unchecked" checked disabled type="checkbox" id="checkbox4" />
            <MDBInput style={{marginLeft:'5px'}} type='checkbox' filled label='Is Extra added?' />


          {/* </div> */}
          </MDBFormInline>
          <div>
      {/* Material unchecked */}
      <MDBInput label="Filled-in unchecked" type="checkbox" id="checkbox1" />

      {/* Material checked */}
      <MDBInput label="Filled-in unchecked" checked type="checkbox" id="checkbox2" />

      {/* Material unchecked disabled */}
      <MDBInput label="Filled-in unchecked" disabled type="checkbox" id="checkbox3" />

      {/* Material checked disabled */}
      <MDBInput label="Filled-in unchecked" checked disabled type="checkbox" id="checkbox4" />
    </div>
      </div>
    );
  }
}

export default Home;
